import "./reserveTutorscr.css"
import "./HeroIm"
import React, { useState, useEffect } from 'react';

function MyComponent() {
  const [users, setUsers] = useState([]);
  const [selectedUser, setSelectedUser] = useState('');

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(data => setUsers(data));
  }, []);

  const handleSelectChange = event => {
    setSelectedUser(event.target.value);
  };

  return (
    <div>
      <label htmlFor="user-select">Choose a user:</label>
      <select id="user-select" value={selectedUser} onChange={handleSelectChange}>
        <option value="">Select a user</option>
        {users.map(user => (
          <option key={user.id} value={user.id}>
            {user.name}
          </option>
        ))}
      </select>
      {selectedUser && <p>You selected {users.find(user => user.id === selectedUser).name}</p>}
    </div>
  );
}

export default MyComponent;
